INSERT INTO `openn_document` VALUES (1,NULL,'2014-12-09 14:59:40','2014-12-09 14:59:42',0,'mscodex1223','medren',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?>\n<TEI xmlns=\"http://www.tei-c.org/ns/1.0\">\n   <teiHeader>\n      <fileDesc>\n         <titleStmt>\n            <title>Description of University of Pennsylvania Ms. Codex 1223: Fragments of the Digests of Justinian, Book 37, Titles 7-9</title>\n         </titleStmt>\n         <publicationStmt>\n            <publisher>The University of Pennsylvania Libraries</publisher>\n            <availability>\n               <licence target=\"http://creativecommons.org/licenses/by/4.0/legalcode\">\n                              This description is ©2014 University of Pennsylvania Libraries. It is licensed under a Creative Commons Attribution License version 4.0 (CC-BY-4.0 https://creativecommons.org/licenses/by/4.0/legalcode. For a description of the terms of use see the Creative Commons Deed https://creativecommons.org/licenses/by/4.0/.\n                            </licence>\n               <licence target=\"http://creativecommons.org/publicdomain/mark/1.0/\">\n                              All referenced images and their content are free of known copyright restrictions and in the public domain. See the Creative Commons Public Domain Mark page for usage details, http://creativecommons.org/publicdomain/mark/1.0/.\n                            </licence>\n            </availability>\n         </publicationStmt>\n         <notesStmt>\n            <note>Ms. leaves.</note>\n            <note>Title supplied by cataloger (Zacour-Hirsch).</note>\n            <note>Layout: Main text written in 2 columns of 50-52 lines; commentary text written in 2 columns of 90-109 lines; horizontal and vertical bounding lines ruled in lead.</note>\n            <note>Script: Written in a Gothic script.</note>\n            <note>Decoration: Initials (1-line to 3-line) alternating in red and blue ink, paragraph marks in red and blue ink, six-line Title 8 initial in red and blue ink.</note>\n            <note>Binding: Modern boards.</note>\n            <note>Origin: Probably written in France in the 15th century (Zacour-Hirsch).</note>\n         </notesStmt>\n         <sourceDesc>\n            <msDesc>\n               <msIdentifier>\n                  <settlement>Philadelphia</settlement>\n                  <institution>University of Pennsylvania</institution>\n                  <repository>Rare Book &amp; Manuscript Library</repository>\n                  <idno type=\"call-number\">Ms. Codex 1223</idno>\n                  <altIdentifier type=\"bibid\">\n                     <idno>4350977</idno>\n                  </altIdentifier>\n                  <altIdentifier type=\"hdl\">\n                     <idno>http://hdl.library.upenn.edu/1017/d/medren/4350977</idno>\n                  </altIdentifier>\n               </msIdentifier>\n               <msContents>\n                  <summary>Bifolium with fragments from Book 37 of the Digests of Justinian I (Byzantine emperor, 527-565), containing (in order) sections of Title 7 on dowries, Title 9 on inheritance, and Title 8 on the children of marriages in which one partner is an emancipated slave. The text is surrounded by 15th-century commentary on the laws.</summary>\n                  <textLang>Latin</textLang>\n                  <msItem>\n                     <title>Fragments of the Digests of Justinian, Book 37, Titles 7-9</title>\n                     <author>Justinian I, Emperor of the East, 483?-565</author>\n                     <respStmt>\n                        <resp>former owner</resp>\n                        <persName>Baugh, Albert C. 1891-1981</persName>\n                     </respStmt>\n                  </msItem>\n                  <msItem n=\"1r\">\n                     <locus>1r</locus>\n                     <title>De dotis collatione (37.7.1.4), f. 1r</title>\n                  </msItem>\n                  <msItem n=\"1v\">\n                     <locus>1v</locus>\n                     <title>De ventre in possessionem mittendo et curatore eius (37.9.1), f. 1v</title>\n                  </msItem>\n                  <msItem n=\"2r\">\n                     <locus>2r</locus>\n                     <title>De coniungendis cum emancipato liberis eius (37.8.1.10), f. 2r</title>\n                  </msItem>\n               </msContents>\n               <physDesc>\n                  <objectDesc>\n                     <supportDesc material=\"paper\">\n                        <support>paper</support>\n                        <extent>2 leaves : 429 x 289 (237 x 135) mm. bound to 439 x 295 mm</extent>\n                     </supportDesc>\n                  </objectDesc>\n                  <decoDesc>\n                     <decoNote n=\"1v\">Puzzle initial, Initial S, f. 1v</decoNote>\n                  </decoDesc>\n               </physDesc>\n               <history>\n                  <origin>\n                     <origDate>14--</origDate>\n                     <origPlace>France?</origPlace>\n                  </origin>\n                  <provenance>Gift of Albert C. Baugh, 1965.</provenance>\n               </history>\n            </msDesc>\n         </sourceDesc>\n      </fileDesc>\n      <profileDesc>\n         <textClass>\n            <keywords n=\"subjects\">\n               <term>Roman law.--Early works to 1800</term>\n               <term>Inheritance and succession (Roman law)</term>\n               <term>Marriage (Roman law)</term>\n               <term>Property (Roman law)</term>\n            </keywords>\n            <keywords n=\"form/genre\">\n               <term>Codices</term>\n               <term>Laws (documents)</term>\n               <term>Commentaries</term>\n               <term>Manuscripts, Latin--15th century</term>\n               <term>Manuscripts, Renaissance</term>\n            </keywords>\n         </textClass>\n      </profileDesc>\n   </teiHeader>\n   <facsimile>\n      <surface n=\"Fron