pg\" width=\"69px\"/></surface></facsimile>\n</TEI>\n'),(3,NULL,'2014-12-09 15:00:17','2014-12-09 15:00:20',0,'ljs454','ljs',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?>\n<TEI xmlns=\"http://www.tei-c.org/ns/1.0\">\n   <teiHeader>\n      <fileDesc>\n         <titleStmt>\n            <title>Description of University of Pennsylvania LJS 454: Seiyō senpaku zukai</title>\n         </titleStmt>\n         <publicationStmt>\n            <publisher>The University of Pennsylvania Libraries</publisher>\n            <availability>\n               <licence target=\"http://creativecommons.org/licenses/by/4.0/legalcode\">\n                              This description is ©2014 University of Pennsylvania Libraries. It is licensed under a Creative Commons Attribution License version 4.0 (CC-BY-4.0 https://creativecommons.org/licenses/by/4.0/legalcode. For a description of the terms of use see the Creative Commons Deed https://creativecommons.org/licenses/by/4.0/.\n                            </licence>\n               <licence target=\"http://creativecommons.org/publicdomain/mark/1.0/\">\n                              All referenced images and their content are free of known copyright restrictions and in the public domain. See the Creative Commons Public Domain Mark page for usage details, http://creativecommons.org/publicdomain/mark/1.0/.\n                            </licence>\n            </availability>\n         </publicationStmt>\n         <notesStmt>\n            <note>Ms. roll.</note>\n            <note>Title from outer label. Translated as \"An illustrated guide to Western ships.\"</note>\n            <note>Layout: Written in vertical columns of characters perpendicular to the length of the scroll.</note>\n            <note>Script: Written in Japanese script.</note>\n            <note>Decoration: 4 detailed full side diagrams of ships, 1 with a top pennant that unfolds above the upper edge of the scroll and 1 with a damaged foldout top pennant; 22 partial diagrams, including ship cross-sections and diagrams of astronomical and navigational equipment; many diagrams rubricated in red, some with syllables that are keyed to text describing the parts or areas of a ship.</note>\n            <note>Origin: Written in Nagasaki, circa 1800.</note>\n            <note>Caption title from first preface.</note>\n            <note>Roll has additional textual content after final image with title \"Suisengun kontairyaku kibun.\"</note>\n         </notesStmt>\n         <sourceDesc>\n            <msDesc>\n               <msIdentifier>\n                  <settlement>Philadelphia</settlement>\n                  <institution>University of Pennsylvania</institution>\n                  <repository>Rare Book &amp; Manuscript Library</repository>\n                  <idno type=\"call-number\">LJS 454</idno>\n                  <altIdentifier type=\"bibid\">\n                     <idno>6016920</idno>\n                  </altIdentifier>\n                  <altIdentifier type=\"hdl\">\n                     <idno>http://hdl.library.upenn.edu/1017/d/medren/6016920</idno>\n                  </altIdentifier>\n               </msIdentifier>\n               <msContents>\n                  <summary>Scroll of diagrams and text concerning the construction and compartmentalization of European ships, referred to as battleships, all on the recto side. At the top of the scroll is a thin piece of wood and a tie that wraps around the scroll; a paper label in Japanese is on the verso of the beginning of the scroll. Sheets of a different kind of paper, of the same width but different length, are used for backing.</summary>\n                  <textLang mainLang=\"jpn\">Japanese</textLang>\n                  <msItem>\n                     <title>Seiyō senpaku zukai</title>\n                     <respStmt>\n                        <resp>translator</resp>\n                        <persName>Motoki, Shōei, 1767-1822</persName>\n                     </respStmt>\n                  </msItem>\n               </msContents>\n               <physDesc>\n                  <objectDesc>\n                     <supportDesc material=\"paper\">\n                        <support>paper</support>\n                        <extent>1 roll (34 sheets) : 37 x 894 cm</extent>\n                     </supportDesc>\n                  </objectDesc>\n                  <decoDesc>\n                     <decoNote n=\"Closed scroll\">Scroll label, Closed scroll</decoNote>\n                     <decoNote n=\"Opening 13\">Full ship diagram, Opening 13</decoNote>\n                     <decoNote n=\"Opening 14\">Partial ship diagram, Opening 14</decoNote>\n                     <decoNote n=\"Opening 15\">Full ship diagram, Opening 15</decoNote>\n                     <decoNote n=\"Opening 16\">Partial ship diagram, Opening 16</decoNote>\n                     <decoNote n=\"Opening 17\">Cross-section diagram, Opening 17</decoNote>\n                     <decoNote n=\"Opening 18\">Small partial diagrams, Opening 18</decoNote>\n                     <decoNote n=\"Opening 19\">Small partial diagrams, Opening 19</decoNote>\n                     <decoNote n=\"Opening 20\">Small partial diagrams, Opening 20</decoNote>\n                     <decoNote n=\"Opening 21\">Navigational instruments, Opening 21</decoNote>\n                     <decoNote n=\"Opening 23\">Full ship diagram, Opening 23</decoNote>\n                     <decoNote n=\"Opening 24\">Full ship diagram, Opening 24</decoNote>\n                  </decoDesc>\n               </physDesc>\n               <history>\n                  <origin>\n                     <origDate>after 1808</origDate>\n                     <origPlace>Nagasaki, Japan</origPlace>\n                  </origin>\n                  <provenance>Sold by Sam Fogg Ltd. (London) to Lawrence J. Schoenberg, 1999.</provenance>\n                  <provenance>Deposit by Lawrence J. Schoenberg and Barbara Brizdle, 2013.</provenance>\n               </history>\n            </msDesc>\n         </sourceDesc>\n      </fileDesc>\n      <profileDesc>\n         <textClass>\n            <keywords n=\"subjects\">\n               <term>Merchant ships--History</term>\n               <term>Warships--History</term>\n               <term>Naval architecture--History</term>\n               <term>Astronomical instruments--Early works to 1800</term>\n            </keywords>\n            <keywords n=\"form/genre\">\n               <term>Diagrams</term>\n               <term>Scrolls (information artifacts)</term>\n               <term>Manuscripts, Japanese--18th century</term>\n               <term>Manuscripts, Japanese--19th century</term>\n               <term>Manuscripts, Digital</term>\n            </keywords>\n         </textClass>\n      </profileDesc>\n   </teiHeader>\n   <facsimile>\n      <surface n=\"Closed scroll\"><graphic height=\"200px\" url=\"data/master/0003_0000.tif\" width=\"183px\"/><graphic height=\"190px\" url=\"data/thumb/0003_0000_thumb.jpg\" width=\"173px\"/><graphic height=\"200px\" url=\"data/web/0003_0000_web.jpg\" width=\"183px\"/></surface><surface n=\"Opening 1\"><graphic height=\"200px\" url=\"data/master/0003_0001.tif\" width=\"183px\"/><graphic height=\"190px\" url=\"data/thumb/0003_0001_thumb.jpg\" width=\"173px\"/><graphic height=\"200px\" url=\"data/web/0003_0001_web.jpg\" width=\"183px\"/></surface><surface n=\"Opening 2\"><graphic height=\"200px\" url=\"data/master/0003_0002.tif\" width=\"183px\"/><graphic height=\"190px\" url=\"data/thumb/0003_0002_thumb.jpg\" width=\"173px\"/><graphic height=\"200px\" url=\"data/web/0003_0002_web.jpg\" width=\"183px\"/></surface><surface n=\"Opening 3\"><graphic height=\"200px\" url=\"data/master/0003_0003.tif\" width=\"183px\"/><graphic height=\"190px\" url=\"data/thumb/0003_0003_thumb.jpg\" width=\"173px\"/><graphic height=\"200px\" url=\"data/web/0003_0003_web.jpg\" width=\"183px\"/></surface><surface n=\"Opening 4\"><graphic height=\"200px\" url=\"data/master/0003_0004.tif\"